const StyledCard = withStyles({
    root: {
        maxWidth: 345,
    },
  })(Card);

class FeedItem extends Component {

  render() {
    return (
        <StyledCard>
        <CardActionArea>
            {/* <CardMedia
                component="img"
                alt="Contemplative Reptile"
                height="140"
                imageUrl={this.props.urlToImage}
                title="Contemplative Reptile"
            /> */}
            {/* <CardMedia imageUrl='https://images.pexels.com/photos/67636/rose-blue-flower-rose-blooms-67636.jpeg' /> */}
            <img src="https://i.insider.com/5e73e665c48540255c247cc3?width=1200&format=jpeg" alt="Flowers in Chania" width="460" height="345" />
            <CardContent>
            <Typography gutterBottom variant="h5" component="h2">
                {this.props.title}
            </Typography>
            <Typography variant="body2" color="textSecondary" component="p">
                {this.props.description}
            </Typography>
            </CardContent>
        </CardActionArea>
        <CardActions>
            <Button size="small" color="primary">
            Share
            </Button>
            <a href={this.props.url} target="_blank" rel="noopener noreferrer">
                <Button size="small" color="primary">
                Learn More
                </Button>
            </a>
        </CardActions>
        </StyledCard>
    );
  }
}

export default FeedItem;
